import React from "react"
import styled from "styled-components"
import FILE1 from "../components/files/file1"

const Li = styled.li`
  width: 40px;
  height: 40px;
  text-align: center;
  line-height: 40px;
  border-radius: 50%;
`
const Home = () => {
  return (
    <div>
      <div>
        <ul>
          <li style={Li}>1</li>
          <li>2</li>
          <li>3</li>
        </ul>
      </div>
      <table border={1}>
        <tr>
          <th>ID voice</th>
          <td>duration</td>
        </tr>
        {FILE1.map((item) => (
          <tr key={item.voice_id}>
            <th>{item.voice_id}</th>
            <td>{item.audioCredit.callDuration}</td>
          </tr>
        ))}
      </table>
    </div>
  )
}

export default Home
